import React from 'react'
import styled from 'styled-components'

const Block = styled.div`
  background: grey;
  font-size: 2rem;
  text-align: center;
`

const StatBlock = ({ title, data }) => {
  return (
    <div className="statBlock">
      <h3>{title}:</h3>
      <span>{data}</span>
    </div>
  )
}

export default StatBlock;
